 @gregoryscieditz8936  sério? Então vamos aos fatos. Conquistas do Flamengo após a década de 80:
90: Copa do Brasil;
92: campeonato brasileiro;
96: Copa ouro;
97: copa dos campeões mundiais;
99: copa mercosul;
2001: Copa dos campeões;
2006: Copa do Brasil; 2009: campeonato brasileiro;
2013: Copa do Brasil;
2019: campeonato brasileiro e Copa libertadores da América;
2020: campeonato brasileiro.
Fora os campeonatos cariocas que são muitos e eu não me lembro de cabeça. Não sei de onde você tirou que a gente não ganhou nada depois da década de 80.

